import React from 'react'
import { makeStyles } from '@material-ui/core/styles'
import Table from '@material-ui/core/Table'
import TableBody from '@material-ui/core/TableBody'
import TableCell from '@material-ui/core/TableCell'
import TableContainer from '@material-ui/core/TableContainer'
import TableHead from '@material-ui/core/TableHead'
import TableRow from '@material-ui/core/TableRow'
import Paper from '@material-ui/core/Paper'

const useStyles = makeStyles({
  table: {
    minWidth: 100,
  },
})

function createData(name, calories, fat, carbs, protein, date) {
  return { name, calories, fat, carbs, protein, date }
}

const fechita = new Date()
const rows = [
  createData('Frozen yoghurt', 159, 6.0, 24, 4.0, fechita),
  createData('Ice cream sandwich', 237, 9.0, 37, 4.3, fechita.toISOString()()),
  createData('Eclair', 262, 16.0, 24, 6.0, fechita.toDateString()),
  createData('Cupcake', 305, 3.7, 67, 4.3, fechita.toDateString()),
  createData('Gingerbread', 356, 16.0, 49, 3.9, fechita.toDateString()),
]

export default function LastOperations() {
  const classes = useStyles()

  return (
    <TableContainer component={Paper}>
      <Table className={classes.table} size="small" aria-label="a dense table">
        <TableHead>
          <TableRow>
            <TableCell>Concepto</TableCell>
            <TableCell align="right">Monto</TableCell>
            <TableCell align="right">Tipo</TableCell>
            <TableCell align="right">Fecha y hora</TableCell>
          </TableRow>
        </TableHead>
        <TableBody>
          {rows.map((row) => (
            <TableRow key={row.name}>
              <TableCell component="th" scope="row">
                {row.name}
              </TableCell>
              <TableCell align="right">{row.calories}</TableCell>
              <TableCell align="right">{row.fat}</TableCell>
              <TableCell align="right">{row.date}</TableCell>
            </TableRow>
          ))}
        </TableBody>
      </Table>
    </TableContainer>
  )
}
